import React from "react"
import "./App.css"
import HomePage from "./pages/homepage.component"

const WesternPage = () => (
  <div>
    <h1>Western Guitars</h1>
  </div>
)

function App() {
  return (
    <div>
      <HomePage />
    </div>
  )
}

export default App
